import React, { Component } from 'react'
import Tile from './Tile.js';
import { tileGridData } from './tileGridData.js';

export default class TileGrid extends Component {
    constructor(props) {
        super(props);
        this.state = {
          count: 0,
        };

        this.test = () => console.log('test');
    }

    updateTileData(name) {
        console.log(name);
    }

    getRandomTile() {
        var names = ['bmo','finn','ice-king','jake','lumpy-space-princess','marceline','princess-bubblegum'];
        var bools = [false,false,false,false,true];
        var randName = names[(Math.random() * names.length) | 0]
        var randFolder = bools[(Math.random() * bools.length) | 0]
        return (<Tile name={randName.replace('-',' ')} image={randName} isFolder={randFolder} func={this.updateTileData} />)
    }


    render() {
        return (
            <div>
                <div className='tileGrid'>
                    {tileGridData.home.map(object => <Tile {...object} func={this.updateTileData} />) }
                </div>
            </div>

        )
    }
}
